    protected async override void OnAppearing()
    {
        base.OnAppearing();
        try
        {
            await LoadBasemapAsync(Path.Combine(GetFilesDirectory(), Properties.Resources.BasemapFileName));
            await LoadUtilityNetworkAsync(Path.Combine(GetFilesDirectory(), Properties.Resources.GeodatabaseFileName));
        }
        catch
        {
        }
    }

    protected override void LayoutChildren(double x, double y, double width, double height)
    {
        base.LayoutChildren(x, y, width, height);
        MyMapView.ViewInsets = new Thickness(Panel.X + Panel.Width, 0, 0, 0);
    }

    #region Load Basemap and Geodatabase
    private async void LoadBasemapAsync(object sender, EventArgs e)
    {
        try
        {
            if (MyMapView.Map?.Basemap is null)
            {
                var file = await FilePicker.Default.PickAsync();
                if (file is not null)
                {
                    await LoadBasemapAsync(file.FullPath);
                }
            }
        }
        catch
        {
        }
    }

    private async Task LoadBasemapAsync(string vtpkPath)
    {
        if (!File.Exists(vtpkPath))
        {
            return;
        }

        var tileCache = await VectorTileCache.CreateAsync(vtpkPath);
        MyMapView.Map = new Map(new Basemap(new ArcGISVectorTiledLayer(tileCache)));
        MyMapView.SetViewpoint(new Viewpoint(_initialExtent));

        MyMapView.GraphicsOverlays ??= new GraphicsOverlayCollection();

        _outageOverlay = new GraphicsOverlay() { Id = "OutageReport", Renderer = new SimpleRenderer(Symbol.FromJson(SymbolJsonDictionary["OutageReport"])) };
        MyMapView.GraphicsOverlays.Add(_outageOverlay);

        _startingPointOverlay = new GraphicsOverlay() { Id = "StartingPoint", Renderer = new SimpleRenderer(Symbol.FromJson(SymbolJsonDictionary["StartingPoint"])) };
        MyMapView.GraphicsOverlays.Add(_startingPointOverlay);

        LoadBasemap.IsVisible = false;
        LoadGdb.IsVisible = true;
    }

    private async void LoadUtilityNetworkAsync(object sender, EventArgs e)
    {
        try
        {
            if (MyMapView.Map.UtilityNetworks.FirstOrDefault()?.Geodatabase is null)
            {
                LoadGdb.IsVisible = false;
                var file = await FilePicker.Default.PickAsync();
                if (file is not null)
                {
                    await LoadUtilityNetworkAsync(file.FullPath);
                }
            }
        }
        catch
        {
       }
    }
    private async Task LoadUtilityNetworkAsync(string gdbPath)
    {
        if (MyMapView?.Map is null || !File.Exists(gdbPath))
        {
            return;
        }

        var geodatabase = await Geodatabase.OpenAsync(gdbPath);
        if (geodatabase.UtilityNetworks.Count <= 0)
        {
            return;
        }

        LoadGdb.IsVisible = false;

        var utilityNetwork = geodatabase.UtilityNetworks[0];
        MyMapView.Map.UtilityNetworks.Add(utilityNetwork);
        await utilityNetwork.LoadAsync();

        MyMapView.Map.OperationalLayers.Clear();

        foreach (var item in RendereJsonDictionary)
        {
            if (utilityNetwork.Definition?.GetNetworkSource(item.Key)?.FeatureTable is not ArcGISFeatureTable table)
                continue;

            var layer = new FeatureLayer(table) { Renderer = Renderer.FromJson(item.Value) };
            await layer.LoadAsync();

            layer.IsVisible = InitialLayerList.Contains(layer.Name);

            MyMapView.Map.OperationalLayers.Insert(0, layer);
        }

        await Task.Delay(500);
        Badge.IsVisible = true;
    }
    #endregion

    // 1)
    private async Task LoadOutageReportAsync()
    {
        if (_outageOverlay is null ||
            _outageOverlay.Graphics.Count > 0 ||
            MyMapView?.Map?.UtilityNetworks.FirstOrDefault() is not UtilityNetwork utilityNetwork)
        {
            return;
        }

        foreach (var layer in MyMapView.Map.OperationalLayers)
        {
            layer.IsVisible = true;
        }

        _outageOverlay.Graphics.Add(new Graphic(OutageAddressLocation));

        // Get the Electric Device feature table
        var deviceSource = utilityNetwork.Definition?.GetNetworkSource(DeviceNetworkSourceName);
        var featureTable = deviceSource?.FeatureTable;
        if (featureTable is null)
        {
            return;
        }

        // Get the Transformer feature nearest to the outage report
        var queryParameters = new QueryParameters { WhereClause = $"GLOBALID = '{TransformerGlobalId}'" };
        var features = await featureTable.QueryFeaturesAsync(queryParameters);
        var feature = features.FirstOrDefault();
        if (feature is null)
        {
            return;
        }

        _transformerFeature = feature as ArcGISFeature;

        // Create an Extent that compasses both the outage and the transformer
        var projectedTransformerGeom = GeometryEngine.Project(_transformerFeature.Geometry.Extent, SpatialReferences.WebMercator);
        var combinedExtents = projectedTransformerGeom.CombineExtents(OutageAddressLocation);
        _ = MyMapView.SetViewpointGeometryAsync(combinedExtents.Buffer(25), 600d);

        // Update UI
        IncidentAddress.Text = OutageAddress;
        IncidentAssetId.Text = OutageAssetId;
        IncidentAddress.IsVisible = true;
        Badge.IsVisible = false;
    }

    // 1a)
    private async Task FindNearestTransformerAsync()
    {
        if (_transformerFeature is null)
        {
            return;
        }

        // Update UI
        _customerReport.Clear();
        CustomerList.IsVisible = false;
        DownstreamTrace.IsVisible = false;
        SaveResults.IsVisible = false;

        // Clear map selection and graphics
        _startingPointOverlay.Graphics.Clear();
        ClearSelection();

        // Select the feature and add an outage Graphic
        (_transformerFeature?.FeatureTable?.Layer as FeatureLayer)?.SelectFeature(_transformerFeature);
        var geometry = GeometryEngine.Project(_transformerFeature?.Geometry, MyMapView?.SpatialReference);
        _startingPointOverlay.Graphics.Add(new Graphic(geometry));

        // Update UI
        await Task.Delay(500);
        UpstreamTrace.IsVisible = true;
        OutageReportGrid.IsVisible = false;
        LocateOutageHeader.IsEnabled = false;
    }

    // 2)
    private async Task FindUpstreamSwitchAsync()
    {
        if (MyMapView?.Map is null ||
            MyMapView?.Map?.UtilityNetworks.FirstOrDefault() is not UtilityNetwork utilityNetwork ||
            _transformerFeature is null)
        {
            return;
        }

        // Update UI
        _customerReport.Clear();
        _startingPointOverlay.Graphics.Clear();
        CustomerList.IsVisible = false;
        DownstreamTrace.IsVisible = false;
        SaveResults.IsVisible = false;
        ClearSelection();

        // Create a UtilityElement from the selected feature
        var startingPoint = utilityNetwork.CreateElement(_transformerFeature);

        // Set the startingPoint terminal to the upstream terminal, if there is one
        startingPoint.Terminal = startingPoint.AssetType?.
            TerminalConfiguration?.
            Terminals.FirstOrDefault(t => t.IsUpstreamTerminal == true);

        // Get the default UtilityTraceConfiguration for the UtilityTier
        var domainNetwork = utilityNetwork.Definition?.GetDomainNetwork(DomainNetworkName);
        var tier = domainNetwork?.GetTier(TierName);
        var traceConfiguration = tier?.GetDefaultTraceConfiguration();
        if (traceConfiguration is null)
        {
            return;
        }

        // Add a filter barrier to stop tracing when a Medium Voltage Switch
        // feature is found
        var networkAttribute = utilityNetwork.Definition?.GetNetworkAttribute(DeviceAssetGroupName);
        var switchBarrier = new UtilityNetworkAttributeComparison(networkAttribute,
                                                                  UtilityAttributeComparisonOperator.Equal,
                                                                  MediumVoltageSwitchAssetGroup);
        traceConfiguration.Filter = new UtilityTraceFilter() { Barriers = switchBarrier };

        // Start the trace
        var upstreamTraceParameters = new UtilityTraceParameters(UtilityTraceType.Upstream, new[] { startingPoint });
        upstreamTraceParameters.TraceConfiguration = traceConfiguration;

        var traceResults = await utilityNetwork.TraceAsync(upstreamTraceParameters);
        foreach (var result in traceResults)
        {
            if (result is not UtilityElementTraceResult elementResult)
            {
                continue;
            }

            _upstreamElements = new List<UtilityElement>(elementResult.Elements);

            // Select all upstream elements
            var features = await utilityNetwork.GetFeaturesForElementsAsync(_upstreamElements);
            SelectFeatures(features);

            // Get the UtilityAssetType of the terminating switch feature
            var deviceNetworkSource = utilityNetwork.Definition?.GetNetworkSource(DeviceNetworkSourceName);
            var switchAssetType = deviceNetworkSource?.
                GetAssetGroup(SwitchAssetGroupName)?.
                GetAssetType(SwitchAssetTypeName);
            if (switchAssetType is null)
            {
                return;
            }

            // Filter out just the Switch features
            var switchFeatures = features.Where(f =>
                f.FeatureTable?.Layer?.Name == DeviceNetworkSourceName &&
                f.Attributes.ContainsKey("assettype") &&
                (short)f.GetAttributeValue("assettype") == (short)switchAssetType.Code);

            // Add a graphic for the switch, as it'll be out next starting point
            var switchFeature = switchFeatures.FirstOrDefault();
            var geometry = GeometryEngine.Project(switchFeature.Geometry, MyMapView.SpatialReference);
            _startingPointOverlay.Graphics.Add(new Graphic { Geometry = geometry, IsVisible = false });

            var elementExtent = GeometryEngine.CombineExtents(features.Select(m => m.Geometry).OfType<Geometry>().ToList());
            _ = MyMapView.SetViewpointGeometryAsync(elementExtent.Buffer(150));
        }
    }

    // 3)
    private async Task FindDownstreamResidentialsAsync()
    {
        if (MyMapView?.Map is null ||
            MyMapView?.Map?.UtilityNetworks.FirstOrDefault() is not UtilityNetwork utilityNetwork ||
            _upstreamElements is null)
        {
            return;
        }

        // Update UI
        _customerReport.Clear();
        CustomerList.IsVisible = true;
        Result.Text = string.Empty;
        Result.IsVisible = false;
        SendReportToOffice.IsVisible = false;
        ClearSelection();

        // Query for Named Trace Configurations
        UtilityNamedTraceConfigurationQueryParameters ntcQuery = new UtilityNamedTraceConfigurationQueryParameters();
        ntcQuery.Names.Add("DownStream_LowVoltageService");

        var namedTraceConfigurations = await utilityNetwork.QueryNamedTraceConfigurationsAsync(ntcQuery);
        var downstreamNamedTraceConfig = namedTraceConfigurations.FirstOrDefault();
        if (downstreamNamedTraceConfig is null)
        {
            return;
        }

        // Create the UtilityTraceParameters from the NTC object
        var downStreamTraceParameters = new UtilityTraceParameters(downstreamNamedTraceConfig, _upstreamElements);

        // Trace with the NTC
        var traceResults = await utilityNetwork.TraceAsync(downStreamTraceParameters);
        foreach (var result in traceResults)
        {
            if (result is not UtilityElementTraceResult elementResult)
            {
                continue;
            }

            var residentialAssetType = utilityNetwork.Definition?.
                GetNetworkSource(DeviceNetworkSourceName)?.
                GetAssetGroup(ResidentialAssetGroupName)?.
                GetAssetType(ResidentialAssetTypeName);

            Result.Text = $"{elementResult.Elements.Count} {residentialAssetType.Name}s found.";
            Result.IsVisible = true;
            var features = await utilityNetwork.GetFeaturesForElementsAsync(elementResult.Elements);
            SelectFeatures(features);

            var elementExtent = GeometryEngine.CombineExtents(features.Select(m => m.Geometry).OfType<Geometry>().ToList());
            _ = MyMapView.SetViewpointGeometryAsync(elementExtent.Buffer(150));
        }

        // Populate result table and update UI
        SendReportToOffice.IsVisible = true;

        foreach (var item in CustomerReport)
        {
            _customerReport.Add(new KeyValuePair<string, string>(item.Key, item.Value));
        }
    }

    #region UI Thunking
    private void OnClearUpstreamTraceResults(object sender, EventArgs e)
    {
        if (_upstreamElements is null ||
            _customerReport.Count > 0)
        {
            // Not invoked at the right step; either too early or too late
            return;
        }

        ClearSelection();

        foreach (var graphic in _startingPointOverlay.Graphics)
        {
            graphic.IsVisible = true;
        }

        UpstreamTraceButton.IsVisible = false;
        UpstreamTraceLabel.IsEnabled = false;
        DownstreamTrace.IsVisible = true;
    }

    private void OnShowResults(object sender, EventArgs e)
    {
        if (_customerReport.Count == 0)
        {
            // Have not yet performed downstream trace
            return;
        }

        LocateServicePointsLabel.IsEnabled = false;
        DownstreamTraceContent.IsVisible = false;
        SaveResults.IsVisible = true;
    }

    private void OnSendReport(object sender, EventArgs e)
    {
        // NoOp
    }

    private async void FindNearestTransformerAsync(object sender, EventArgs e)
    {
        if (_upstreamElements is not null)
        {
            // Advanced beyond Outage Report step; ignore
            return;
        }

        await FindNearestTransformerAsync();
    }

    private async void LoadOutageWorkOrderAsync(object sender, EventArgs e)
    {
        await LoadOutageReportAsync();
    }

    private async void FindUpstreamSwitchAsync(object sender, EventArgs e)
    {
        await FindUpstreamSwitchAsync();
    }

    private async void FindDownstreamResidentialsAsync(object sender, EventArgs e)
    {
        await FindDownstreamResidentialsAsync();
    }
    #endregion

    #region Helpers
    private void SelectFeatures(IEnumerable<Feature> features)
    {
        var groupedFeatures = features.GroupBy(e => e.FeatureTable?.Layer as FeatureLayer, e => e, (key, value) => new { Layer = key, Features = value.ToList() });

        foreach (var item in groupedFeatures)
        {
            item.Layer?.SelectFeatures(item.Features);
        }
    }

    private void ClearSelection()
    {
        var featureLayers = MyMapView?.Map?.OperationalLayers.OfType<FeatureLayer>();
        if (featureLayers != null)
        {
            foreach (var layer in featureLayers)
            {
                layer.ClearSelection();
            }
        }
    }

    private String GetFilesDirectory()
    {
        if (Properties.Resources.FilesDirectory.Length > 0)
        {
            return Properties.Resources.FilesDirectory;
        }

        return FileSystem.Current.AppDataDirectory;
    }
    #endregion
